import Vue from 'vue';
import Vuetify from 'vuetify/lib/framework';

Vue.use(Vuetify);

export default new Vuetify({
  icons: {
    iconfont: 'mdi',
    values: {
      account: 'mdi-account',
      gtihub: 'mdi-github',
      insta: 'mdi-instagram',
      apple: 'mdi-apple',
    },
  },
});
